import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import HomeServices from "../../../Services/Home";

import "./GamePlays.css";

const Gameplay = () => {
  const [thumb, setThumb] = useState([]);
  const [name, setName] = useState([]);
  const [slug, setSlug] = useState([]);

  useEffect(() => {
    HomeServices.gameplay().then((res) => {
      console.log("hoem-chamou: ", res);

      setThumb(res.map((res) => res.thumb));
      setName(res.map((res) => res.name));
      setSlug(res.map((res) => res.slug));
    });
  }, []);

  return (
    <div className="gameplay">
      {name &&
        name.map((pic, i) => {
          return (
            <div key={i} className="gameplay-block">
              <div>
                <Link to={`/${pic.slug}`}>
                  <img src={`/${pic.thumb}`} alt={pic.thumb} />
                </Link>
              </div>
              <div className="gameplay-title">
                <Link to={`/${pic.slug}`}>
                  <span>{pic.name}</span>
                </Link>
              </div>
            </div>
          );
        })}
    </div>
  );
};

export default Gameplay;
